import { Link } from 'react-router-dom';

export default function TripTable(props){
    const price = Number(props.obj.line.price)
    const extra_changes = Number(props.obj.extra_changes)
    const totalPrice = price + extra_changes

    return(
        <tr key={props.obj.id} style={{textAlign:"center"}}>
            <td key={props.obj.id +""+ 1}>{props.obj.name} </td>
            <td key={props.obj.id +""+ 2}>{props.obj.start_time}</td>
            <td key={props.obj.id +""+ 3}>{props.obj.end_time}</td>
            <td key={props.obj.id +""+ 4}>{totalPrice}</td>
            <td key={props.obj.id +""+ 5}><Link to={`/trips/${props.obj.id}/tickets/`} style={{textDecoration: "none"}}>Mua v√©</Link></td>
        </tr>
    )
}
